import React, { useEffect, useState } from 'react';
import { getTransactionHistory } from '../../services/api';
import './TransactionHistory.styles.css';

/**
 * Define la estructura del tipo de las transacciones.
 */
interface Transaction {
  type: string;
  details: string;
  date: string;
}

/**
 * Componente para mostrar el historial de transacciones.
 * Muestra las transacciones recientes de apertura y cancelación.
 */
const TransactionHistory: React.FC = () => {
  // Inicializa el estado con el tipo definido
  const [transactions, setTransactions] = useState<Transaction[]>([]);

  /**
   * Carga el historial de transacciones al montar el componente.
   */
  useEffect(() => {
    const fetchTransactions = async () => {
      try {
        const data: Transaction[] = await getTransactionHistory(); // Asegúrate de que `getTransactionHistory` retorne el tipo correcto
        setTransactions(data);
      } catch (error) {
        console.error('Error fetching transaction history', error);
      }
    };

    fetchTransactions();
  }, []);

  return (
    <div className="transaction-history">
      <h2>Transaction History</h2>
      <ul>
        {transactions.map((transaction, index) => (
          <li key={index}>
            <strong>{transaction.type}</strong>: {transaction.details} - {transaction.date}
          </li>
        ))}
      </ul>
    </div>
  );
};

export default TransactionHistory;
